import React, { useState } from 'react';
import './login.css';

const Login = () => {
  const [values, setValues] = useState({
    password: '',
    email: '',
  });

  return (
    <div className="wrapper">
      <form>
        <input value={values.email} />
        <input value={values.password} />
      </form>
    </div>
  );
};

export default Login;
